class Solution {
public:
    long long maximumValueSum(vector<vector<int>>& board) {
        long long d1[105];
        long long d2[105][105];
        long long res=-1e12;
        int n=board.size(),m=board[0].size();
        for(int i=0;i<m;++i)
        {
            d1[i]=board[0][i];
            for(int j=0;j<m;++j)
                d2[i][j]=-1e12;
        }
        long long x;
        for(int i=1;i<n;++i)
        {
            for(int j=0;j<m;++j)
            {
                x=board[i][j];
                for(int t1=0;t1<m;++t1)
                    for(int t2=t1+1;t2<m;++t2)
                        if(j!=t1&&j!=t2){
                            res=max(res,x+d2[t1][t2]);
                        }
            }
            for(int j=0;j<m;++j)
                for(int t2=0;t2<m;++t2)
                    if(j!=t2){
                        d2[t2][j]=d2[j][t2]=max(d2[j][t2],board[i][j]+d1[t2]);
                    }
            for(int j=0;j<m;++j)
                d1[j]=max(d1[j],(long long)board[i][j]);
        }
        return res;
    }
};
